import React from "react";
import classes from './Button.module.css';

const Button = (props) => {
  /*
    We want to set this button up such that when
    it's clicked, we pass in a function that
    communicates with NewUser.js.
    */

  return (
    <button className={classes.button} type={props.type} onClick={props.onAddUser}>
      {props.children}
    </button>
  );
};

export default Button;
